import React from "react";
import Scroll from "react-scroll";
import styled from "styled-components";

var Element = Scroll.Element;

const Post = styled.div``;

function Verticalscroll() {
  return (
    <Post>
      <Item>
        <CardImage src={cryptotracker} alt="" />
        <CardLangIcons>
          <CardIcon src={reactlogo} style={{ width: "90px", height: "40px" }} />
          <CardIcon
            src={htmllogo}
            style={{
              width: "90px",
              height: "40px",
              marginLeft: "-25px",
            }}
          />
          <CardIcon
            src={npmlogo}
            style={{ width: "90px", height: "40px", marginLeft: "-20px" }}
          />
          <CardIcon
            src={csslogo}
            style={{ width: "90px", height: "40px", marginLeft: "-20px" }}
          />
        </CardLangIcons>
        <CardDescription>
          <h1
            style={{
              fontSize: "20px",
              marginBottom: "-20px",
              padding: "0",
              fontWeight: "bold",
            }}
          >
            Crypto Market Tracker
          </h1>
          <br /> Libraries Used:
          <br />- Axios [For API]
          <br />- Framer Motion[Animation]
          <br />- Styled-Components[CSS]
        </CardDescription>
        <CardGitLogo>
          <a
            href="https://nisarg38.github.io/reactjs-api-crypto-tracker/"
            target="_blank"
            rel="noreferrer"
          >
            <CardIcon
              src={livelogo}
              style={{
                width: "40px",
                height: "40px",
                marginRight: "10px",
              }}
            />
          </a>
          <a
            href="https://github.com/Nisarg38/reactjs-api-crypto-tracker"
            target="_blank"
            rel="noreferrer"
          >
            <CardIcon
              src={githublogo}
              style={{
                width: "40px",
                height: "40px",
                marginRight: "-40px",
              }}
            />
          </a>
        </CardGitLogo>
      </Item>
    </Post>
  );
}

export default Verticalscroll;
